// SPDX-License-Identifier: MIT
pragma solidity >=0.8.0 <0.9.0;

contract eVoting {

  enum Status {
    NOTSTART,
    ONGOING,
    END
  }

  struct Parties {
    string name;
    int256 votes;
  }

  struct User {
    address id;
    string name;
    bool status;
  }

  Parties[] public party;
  address owner;
  Status votingStatus = Status.NOTSTART;
  mapping(address => User) public users;


  event CreatedUser(string _name);

  constructor() {
    owner = msg.sender;
  }

  modifier adminOnly {
    require(msg.sender == owner, "Admin only can access it");
    _;
  }

  modifier userExist {
    require(users[msg.sender].id == address(0),"User already exist");
    _;
  }

  modifier voteVerf {
    require(users[msg.sender].id != address(0), "Not register yet");
    require(votingStatus == Status.ONGOING, "Voting not started yet");
    _;
  }

  function createParty(uint number, string[] memory parties) public adminOnly {
    for(uint i=0; i< number; i++) {
      party.push(Parties({
        name: parties[i],
        votes: 0
      }));
    }
  }

  function getVotings() public view adminOnly returns(Parties[] memory) {
    return party;
  }

  function statusVoting(int status) public {
    if(status == 1 )
      votingStatus = Status.ONGOING;
    else if (status == 0) {
      votingStatus == Status.END;
    }
  }

function createUser(string memory _name) public payable {
  // Access the user data directly from the mapping
  users[msg.sender] = User({
    name: _name,
    id: msg.sender,
    status: false
  });

  emit CreatedUser(_name);
}

  function userVoting(uint partyNumber) public voteVerf payable {
    party[partyNumber].votes++;
    User storage tmp = users[msg.sender];
    tmp.status = true;
  }

}
